import React from 'react'
import { View, StyleSheet, Text, TextInput } from "react-native";


const Input = (props) => {
    return  <TextInput sty {...props} />;
            
       
  
}

export default Input
const styles = StyleSheet.create({
    input: {
      width:50,
      textAlign: "center",  
      height: 30,
      borderBottomColor: "grey",
      borderBottomWidth:1,
      marginVertical:10
    },
  });
